  return (<>
<div class=" bg-gradient-to-r from-slate-950 from-10% via-slate-820 via-30% to-zinc-600 to-90% ... ">


<Head/>
<div className=' flex h-1/2 justify-center'>
 <div className='w-96 pl-6 pt-3 '><Text/></div>

